- input: "TEXT\x1CC00188367\x1CTEXT-00001\x1C\x1CF3XA\x1CWe are in receipt of your
    letter dated 4/15/09 regarding the Amended Pre-General report.  As indicated in
    the original report we identified that the contribution from Service Employees
    Intl. Union #04613  was deposited to the Federal Account in error. We corrected
    the problem as soon as it was identified.  The contribution was transferred to
    the Non-federal account on 10/21/08. In the course of responding to your letter
    we identified an error  in the Post General report where this transaction occurred.
    The disbursement transferring the contribution was accidentally assigned to  Schedule
    B unitemized rather than Itemized and therefore was not itemized nor did the text
    memo explaining the transaction appear on the report.  We have corrected this
    error and the necessary amendment will be forthcoming.The receipts reported on
    Schedule A Line 15 from  Wyden for Senate, Future PAC,   and Senate Democratic
    Leadership Fund are offsets for the payment of rent. The Democratic Party of Oregon
    shares office space with several organizations. We write one check to pay rent.
    The amount of rent paid by each organization is assessed at the usual and normal
    charge, determined by the amount of space occupied by the organization.Voter lists
    are purchased at Fair Market Value determined by market rate per record. Please
    note that transfers from the Democratic National Committee were deposited in a
    segregated account and not used for any Exempt Activity. Yard signs were paid
    for by permitted funds. This activity met the Exempt activity definition. Expenditures
    for postage totaling $221.67 reported on Line 21(b) were for normal State Party
    mail and not for any Public Communication. The expenditure for Fundraising Consulting
    was for generic State Party fundraising and not on behalf of any identified federal
    candidate. The expenditure for Deposit was for a deposit to reserve a venue for
    a 2009 conference. As indicated in the Miscellaneous Filing filed 10/24/08  we
    were experiencing extreme technical problems. There was an internet problem with
    our software online acccess. Service kept being interrupted which caused both
    the duplication and loss of some transactions. When filing the original report
    we were forced to file an inaccurate report rather than not filing at all. We
    filed the amended report as soon as we could identify and resolve the issues.
    As internet problems persisted we wanted to be sure the amendment was accurate
    before filing the next report . We have identified  contributors in our database
    with duplicate entries.  We have merged the records and as a result the itemized
    and unitemized contributions have changed. Total contributions remain the same.
    \ Occupation/Employer information received since the last report has been updated.In
    addition this amendment is necessary due to an amendment of a previous report
    in which a contribution was reassigned to a different line. This report corrects
    aggregate YTD totals on the summary page.\n"
